const person = {
  firstName: "Shradha",
  lastName: "Zilpe",
  city: "Ngp"
}

console.log(person.firstName) 
console.log(person.lastName) 
console.log(person.city) 

// destructuring

const { firstName, lastName, city } = person; 
console.log(firstName) 
console.log(lastName) 
console.log(city)
